// unique identifier per struct
func generatesIdentifier(gongStructName string, idx int, instanceName string) (identifier string) {

	identifier = fmt.Sprintf("__%s__%06d_%s",
		gongStructName,
		idx,
		strings.ReplaceAll(instanceName, " ", "_"))

	return
}
